CREATE PROCEDURE [dbo].[CustomColumnSettings_Save]
    @UserName NVARCHAR(256),
    @TableName NVARCHAR(256),
    @CustomColumnTable udttCustomColumnTable READONLY
AS
	MERGE CustomColumnSettings AS TARGET
	USING @CustomColumnTable AS SOURCE
	ON (
        TARGET.UserName = SOURCE.UserName AND
        TARGET.TableName = SOURCE.TableName AND
        TARGET.DisplayedColumn = SOURCE.DisplayedColumn
        )
    WHEN MATCHED THEN
        UPDATE SET SortOrder = SOURCE.SortOrder
	WHEN NOT MATCHED BY TARGET THEN
		INSERT (UserName, TableName, DisplayedColumn, SortOrder)
		VALUES (SOURCE.UserName, SOURCE.TableName, SOURCE.DisplayedColumn, SOURCE.SortOrder)
	WHEN NOT MATCHED BY SOURCE AND TARGET.UserName = @UserName AND TARGET.TableName = @TableName
	THEN DELETE;
GO
