CREATE PROCEDURE [dbo].[ecf_CatalogEntry_Name]
	@Name nvarchar(100) = '',
	@ClassTypeId nvarchar(50) = '',
	@ReturnInactive bit = 0,
	@ResponseGroup INT = NULL
AS
BEGIN
	if(@ClassTypeId = '')
		set @ClassTypeId = null
