CREATE PROCEDURE [dbo].[ecf_CatalogLanguageSetting_Update]
	@ObjectID INT,
    @ObjectTypeID INT,
	@LanguageBranch NVARCHAR(50),
	@ReplacementBranch NVARCHAR(50) = NULL,
	@LanguageBranchFallback NVARCHAR(1000) = NULL,
	@Active BIT
AS
BEGIN
	IF EXISTS(SELECT * FROM CatalogLanguageSetting WHERE 
        ObjectID=@ObjectID AND
        ObjectTypeID=@ObjectTypeID AND
        LanguageBranch=@LanguageBranch)
		UPDATE CatalogLanguageSetting SET
			ReplacementBranch	= @ReplacementBranch,
			LanguageBranchFallback  = @LanguageBranchFallback,
			Active					= @Active
		WHERE 
            ObjectID=@ObjectID AND 
            ObjectTypeID=@ObjectTypeID AND
            LanguageBranch=@LanguageBranch
	ELSE
		INSERT INTO CatalogLanguageSetting(
				ObjectID,
                ObjectTypeID,
				LanguageBranch,
				ReplacementBranch,
				LanguageBranchFallback,
				Active)
		VALUES(
				@ObjectID,
                @ObjectTypeID,
				@LanguageBranch,
				@ReplacementBranch,
				@LanguageBranchFallback,
				@Active
			)
		
	RETURN 0
END
