	@MarketId nvarchar(8),
	@Epi_MarketName nvarchar(50),
	@Epi_PricesIncludeTax bit = 0
)
AS
BEGIN
	SET NOCOUNT OFF
	DECLARE @Err int
	set transaction isolation level serializable
	begin transaction
		IF NOT EXISTS (SELECT 1 
			from [OrderGroup_ShoppingCart] with (updlock)
			join [OrderGroup] with (updlock) on OrderGroupId = ObjectId 
			where [CustomerId] = @CustomerId 
				and Name = @Name COLLATE DATABASE_DEFAULT 
				and MarketId = @MarketId COLLATE DATABASE_DEFAULT 
				and (@SiteId is null OR SiteId = @SiteId)
				and @OrderGroupId is null)
			begin
				INSERT
				INTO [OrderGroup]
				(
					[InstanceId],
					[AffiliateId],
					[Name],
					[CustomerId],
					[CustomerName],
					[CustomerEmail],
					[AddressId],
					[ShippingTotal],
					[HandlingTotal],
					[TaxTotal],
					[SubTotal],
					[Total],
					[BillingCurrency],
					[Status],
					[ProviderId],
					[SiteId],
					[OwnerOrg],
					[Owner],
					[MarketId],
					[Epi_MarketName],
					[Epi_PricesIncludeTax]
				)
				VALUES
				(
					@InstanceId,
					@AffiliateId,
					@Name,
					@CustomerId,
					@CustomerName,
					@CustomerEmail,
					@AddressId,
					@ShippingTotal,
					@HandlingTotal,
					@TaxTotal,
					@SubTotal,
					@Total,
					@BillingCurrency,
					@Status,
					@ProviderId,
					@SiteId,
					@OwnerOrg,
					@Owner,
					@MarketId,
					@Epi_MarketName,
					@Epi_PricesIncludeTax
				)
				SELECT @OrderGroupId = SCOPE_IDENTITY()
			end
	commit
	SET @Err = @@Error
	RETURN @Err
END
