/****** Object:  StoredProcedure [dbo].[ecf_PurchaseOrder_Filter]    Script Date: 7/22/2024 1:51:06 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[ecf_PurchaseOrder_Filter]
	@SearchValue NVARCHAR (512) = NULL,
	@MartketIds NVARCHAR (512) = NULL,
	@Statuses NVARCHAR (512) = NULL,
	@CreatedFrom DATETIME = NULL,
	@CreatedTo DATETIME = NULL,
	@TimeZoneOffset INT = 0,
    @StartingRecord INT = NULL,
	@RecordsToRetrieve INT = NULL,
	@ReturnTotalCount BIT = 1,
    @SiteId NVARCHAR (255) = NULL,
	@TotalRecords INT OUTPUT
AS
BEGIN
	DECLARE @CountQuery NVARCHAR(4000);
	DECLARE @query NVARCHAR(4000);
	SET @query = 'SELECT	OG.OrderGroupId
		FROM	OrderGroup OG
		INNER JOIN	OrderGroup_PurchaseOrder PO ON OG.OrderGroupId = PO.ObjectId WHERE 1 = 1 '
	IF (@MartketIds IS NOT NULL)
	BEGIN
	SET @query = @query + ' AND OG.MarketId IN(SELECT Item FROM ecf_splitlist(''' + @MartketIds + '''))'
	END
	IF (@Statuses IS NOT NULL)
	BEGIN
	SET @query = @query + ' AND OG.Status IN(SELECT Item FROM ecf_splitlist(''' + @Statuses + '''))'
	END
	IF (@CreatedFrom IS NOT NULL)
	BEGIN
	SET @query = @query + ' AND PO.Created >= @CreatedFrom '
	END
	IF (@CreatedTo IS NOT NULL)
	BEGIN
	SET @query = @query + ' AND PO.Created <= @CreatedTo '
	END
	IF (@SiteId IS NOT NULL)
	BEGIN
	SET @query = @query + ' AND OG.SiteId = @SiteId '
	END
	IF (@SearchValue IS NOT NULL)
	BEGIN
		DECLARE @subQuery1 NVARCHAR(4000)
		DECLARE @subQuery2 NVARCHAR(4000)
		DECLARE @subQuery3 NVARCHAR(4000)
		SET @subQuery1 = @query + ' AND OG.CustomerName LIKE ''' + @SearchValue + '%'''
		SET @subQuery2 = @query + ' AND OG.CustomerEmail LIKE ''' + @SearchValue + '%'''
		SET @subQuery3 = @query + ' AND PO.TrackingNumber LIKE ''' + @SearchValue + '%'''
		SET @query =  @subQuery1 + ' UNION ' + @subQuery2 + ' UNION ' + @subQuery3
	END
	SET @CountQuery = N'SET @TotalRecords = (SELECT COUNT(1) FROM (' + @query + ') AS CountTable)'
	SET @query = @query +
	    ' ORDER BY OG.OrderGroupId DESC
        OFFSET '  + CAST(@StartingRecord AS NVARCHAR(50)) + '  ROWS 
        FETCH NEXT ' + CAST(@RecordsToRetrieve AS NVARCHAR(50)) + ' ROWS ONLY'
	exec sp_executesql @query, 
	    N'
        @MarketIds NVARCHAR(512),
        @Statuses NVARCHAR(512),
        @CreatedFrom DATETIME,
        @CreatedTo DATETIME,
        @SiteId NVARCHAR(255),
        @SearchValue NVARCHAR(512),
        @StartingRecord INT,
        @RecordsToRetrieve INT',
        @MarketIds = @MartketIds, @Statuses = @Statuses, 
        @CreatedFrom = @CreatedFrom, @CreatedTo = @CreatedTo,
        @SearchValue = @SearchValue, @SiteId = @SiteId,
        @StartingRecord = @StartingRecord, @RecordsToRetrieve = @RecordsToRetrieve
	-- Execute for record count
	IF (@ReturnTotalCount = 1)
	BEGIN
		EXEC sp_executesql @CountQuery,
        N'
        @MarketIds NVARCHAR(512),
        @Statuses NVARCHAR(512),
        @CreatedFrom DATETIME,
        @CreatedTo DATETIME,
        @SiteId NVARCHAR(255),
        @SearchValue NVARCHAR(512),
        @TotalRecords INT OUTPUT',
        @MarketIds = @MartketIds, @Statuses = @Statuses, 
        @CreatedFrom = @CreatedFrom, @CreatedTo = @CreatedTo,
        @SearchValue = @SearchValue, @SiteId = @SiteId,
        @TotalRecords = @TotalRecords OUTPUT
	END
	ELSE 
	BEGIN
		SET @TotalRecords = 0
	END
END
GO
