CREATE PROCEDURE [dbo].[ecf_SerializableCart_Save]
	@CartId INT,
	@CustomerId UNIQUEIDENTIFIER,
	@Name NVARCHAR(128),
	@MarketId NVARCHAR(16),
	@Created DATETIME,
	@Modified DATETIME,
	@CustomerName NVARCHAR(255),
	@CustomerEmail NVARCHAR(255),
	@SiteId NVARCHAR(255),
	@Data NVARCHAR(MAX)
AS
BEGIN
	IF(@CartId <= 0)
	BEGIN
		IF NOT EXISTS ( SELECT 1 FROM SerializableCart WHERE  
			Name = @Name COLLATE DATABASE_DEFAULT AND 
			CustomerId = @CustomerId AND 
			MarketId = @MarketId COLLATE DATABASE_DEFAULT AND
			(@SiteId is null OR SiteId = @SiteId))
			BEGIN
				INSERT INTO SerializableCart(CustomerId, [Name], MarketId, Created, Modified, CustomerName, CustomerEmail, SiteId, [Data])
				VALUES (@CustomerId, @Name, @MarketId, @Created, @Modified, @CustomerName, @CustomerEmail, @SiteId, @Data)
				SET @CartId = SCOPE_IDENTITY();
			END
		ELSE
			SET @CartId = -1;
	END
	ELSE
	BEGIN
		UPDATE SerializableCart
		SET 			
			CustomerId = @CustomerId,
			[Name] = @Name,
            MarketId = @MarketId,
			Created = @Created,
			Modified = @Modified,
			CustomerName = @CustomerName,
			CustomerEmail = @CustomerEmail,
			SiteId = @SiteId,
			[Data] = @Data
		WHERE CartId = @CartId
	END
	SELECT @CartId
END
GO
