CREATE PROCEDURE [dbo].[ecf_SerializableCart_Search]
	@SqlClause NVARCHAR (MAX),
	@OrderBy NVARCHAR (MAX),
    @StartingRecord INT,
	@RecordsToRetrieve INT,
	@ReturnTotalCount BIT,
	@TotalRecords INT OUTPUT
AS
BEGIN
	DECLARE @SelectQuery NVARCHAR(MAX)
	DECLARE @FilterQuery NVARCHAR(MAX)
	DECLARE @CountQuery NVARCHAR(MAX)
	DECLARE @FullQuery NVARCHAR(MAX)
	SET @FilterQuery = N' WHERE 1 = 1'
	IF(LEN(@SQLClause) != 0)
	BEGIN
		SET @FilterQuery = @FilterQuery + N' AND (' + @SqlClause + ')'
	END
	IF(LEN(@OrderBy) = 0)
	BEGIN
		SET @OrderBy = ' SerializableCart.Modified DESC'
	END
	SET @SelectQuery = N'SELECT SerializableCart.CartId, SerializableCart.Created, SerializableCart.Modified, SerializableCart.SiteId, SerializableCart.[Data]' +
		' FROM SerializableCart SerializableCart' +
		' LEFT JOIN cls_Contact CustomerContact ON SerializableCart.CustomerId = CustomerContact.ContactId' + @FilterQuery +
		' ORDER BY ' + @OrderBy +
		' OFFSET '  + CAST(@StartingRecord AS NVARCHAR(20)) + ' ROWS ' +
		' FETCH NEXT ' + CAST(@RecordsToRetrieve AS NVARCHAR(20)) + ' ROWS ONLY; '
	SET @CountQuery = N'SET @TotalRecords= (SELECT COUNT(1) FROM SerializableCart SerializableCart ' +
		' LEFT JOIN cls_Contact CustomerContact ON SerializableCart.CustomerId = CustomerContact.ContactId' + @FilterQuery +'); '
	IF (@RecordsToRetrieve = 0)
	BEGIN
		SET @FullQuery =  @CountQuery;
	END
	ELSE IF (@ReturnTotalCount = 1)
	BEGIN
		SET @FullQuery =  @CountQuery + @SelectQuery;
	END
	ELSE
	BEGIN
		SET @FullQuery =  @SelectQuery;
	END
	EXEC SP_EXECUTESQL @FullQuery, N'@TotalRecords INT OUTPUT', @TotalRecords = @TotalRecords OUTPUT
END
GO
