		[DiscountCode] = @DiscountCode,
		[DiscountName] = @DiscountName,
		[DisplayMessage] = @DisplayMessage,
		[DiscountValue] = @DiscountValue
	WHERE 
		[ShipmentDiscountId] = @ShipmentDiscountId
	RETURN @@Error
