/****** Object:  StoredProcedure [dbo].[ecf_ShoppingCart_Filter]    Script Date: 7/22/2024 1:51:06 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[ecf_ShoppingCart_Filter]
	@SearchValue NVARCHAR (512) = NULL,
	@MartketIds NVARCHAR (512) = NULL,
	@CreatedFrom DATETIME = NULL,
	@CreatedTo DATETIME = NULL,
	@TimeZoneOffset INT = 0,
	@ExcludeNames NVARCHAR (1024) = NULL,
    @StartingRecord INT = NULL,
	@RecordsToRetrieve INT = NULL,
	@ReturnTotalCount BIT = 1,
    @SiteId NVARCHAR (255) = NULL,
	@TotalRecords INT OUTPUT
AS
BEGIN
	IF (@RecordsToRetrieve > 0)
	BEGIN
		SELECT	OG.OrderGroupId
		FROM	OrderGroup OG
		INNER JOIN	OrderGroup_ShoppingCart SC ON OG.OrderGroupId = SC.ObjectId
		WHERE	(@SearchValue IS NULL OR 
					(OG.CustomerName LIKE @SearchValue OR
					OG.CustomerEmail LIKE @SearchValue)
				)
				AND (@MartketIds IS NULL OR MarketId IN(SELECT Item FROM ecf_splitlist(@MartketIds)))
				AND (@CreatedFrom IS NULL OR CONVERT(DATETIME, DATEADD(MINUTE, @TimeZoneOffset, SC.Created)) >= @CreatedFrom)
				AND (@CreatedTo IS NULL OR CONVERT(DATETIME, DATEADD(MINUTE, @TimeZoneOffset, SC.Created)) <= @CreatedTo)
				AND (@ExcludeNames IS NULL OR [Name] NOT IN(SELECT Item FROM ecf_splitlist(@ExcludeNames))
                AND (@SiteId IS NULL OR [SiteId] = @SiteId))
		ORDER	BY OG.OrderGroupId DESC
		OFFSET	@StartingRecord ROWS
		FETCH NEXT @RecordsToRetrieve ROWS ONLY;
	END
	-- Execute for record count
	IF (@ReturnTotalCount = 1)
	BEGIN
		SET @TotalRecords = (SELECT COUNT(*) 
				FROM	OrderGroup OG
				INNER JOIN	OrderGroup_ShoppingCart SC ON OG.OrderGroupId = SC.ObjectId
				WHERE	(@SearchValue IS NULL OR 
							(OG.CustomerName LIKE @SearchValue OR
							OG.CustomerEmail LIKE @SearchValue)
						)
						AND (@MartketIds IS NULL OR MarketId IN(SELECT Item FROM ecf_splitlist(@MartketIds)))
						AND (@CreatedFrom IS NULL OR CONVERT(DATETIME, DATEADD(MINUTE, @TimeZoneOffset, SC.Created)) >= @CreatedFrom)
						AND (@CreatedTo IS NULL OR CONVERT(DATETIME, DATEADD(MINUTE, @TimeZoneOffset, SC.Created)) <= @CreatedTo)
						AND (@ExcludeNames IS NULL OR [Name] NOT IN(SELECT Item FROM ecf_splitlist(@ExcludeNames))
                        AND (@SiteId IS NULL OR [SiteId] = @SiteId))
				)
	END
	ELSE 
	BEGIN
		SET @TotalRecords = 0
	END
END
GO
