/****** Object:  StoredProcedure [dbo].[mdpsp_avto_LineItemEx_Update]    Script Date: 7/22/2024 1:51:06 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE procedure [dbo].[mdpsp_avto_LineItemEx_Update]
@ObjectId int,@Language nvarchar(20)=null,@CreatorId nvarchar(100),@Created datetime,@ModifierId nvarchar(100),@Modified datetime,@Retval int out,@f1 bit as
begin
set nocount on
declare @ins bit
begin try
begin transaction
if @ObjectId=-1 select @ObjectId=isnull(MAX(ObjectId),0)+1, @Retval=@ObjectId, @ins=0 from [LineItemEx]
else set @ins=case when exists(select 1 from [LineItemEx] where ObjectId=@ObjectId) then 0 else 1 end
if @Language is null
begin
  if @ins=1 insert [LineItemEx] (ObjectId,CreatorId,Created,ModifierId,Modified,[Epi_IsGift])
  values (@ObjectId,@CreatorId,@Created,@ModifierId,@Modified,@f1)
  else update [LineItemEx] set CreatorId=@CreatorId,Created=@Created,ModifierId=@ModifierId,Modified=@Modified,[Epi_IsGift]=@f1
  where ObjectId=@ObjectId
end
else
begin
  if @ins=1 insert [LineItemEx] (ObjectId,CreatorId,Created,ModifierId,Modified,[Epi_IsGift])
  values (@ObjectId,@CreatorId,@Created,@ModifierId,@Modified,@f1)
  else update [LineItemEx] set CreatorId=@CreatorId,Created=@Created,ModifierId=@ModifierId,Modified=@Modified,[Epi_IsGift]=@f1
  where ObjectId=@ObjectId
  if not exists (select 1 from [LineItemEx_Localization] where ObjectId=@ObjectId and Language=@Language)
  insert [LineItemEx_Localization] (ObjectId,Language,ModifierId,Modified)
  values (@ObjectId,@Language,@ModifierId,@Modified)
  else update [LineItemEx_Localization] set ModifierId=@ModifierId,Modified=@Modified,[Epi_IsGift]=null
  where ObjectId=@ObjectId and Language=@language
end
commit transaction
end try
begin catch
  declare @m nvarchar(4000),@v int,@t int
  select @m=ERROR_MESSAGE(),@v=ERROR_SEVERITY(),@t=ERROR_STATE()
  rollback transaction
  raiserror(@m, @v, @t)
end catch
end

GO
