CREATE PROCEDURE [dbo].[SiteCatalogListBySite]
	@SiteId UNIQUEIDENTIFIER
AS
BEGIN
	IF EXISTS(SELECT TOP 1 * FROM dbo.SiteCatalog)
		BEGIN
			SELECT C.* 
			FROM [Catalog] C
			JOIN dbo.SiteCatalog SC ON SC.CatalogId = C.CatalogId
			WHERE SiteId = @SiteId
			SELECT DISTINCT L.* 
			FROM [CatalogLanguage] L
			JOIN dbo.SiteCatalog SC ON SC.CatalogId = L.CatalogId
			WHERE SiteId = @SiteId
		END
	ELSE
		BEGIN
			SELECT C.* 
			FROM [Catalog] C
			SELECT DISTINCT L.* 
			FROM [CatalogLanguage] L
		END
END
GO
